import React from "react";
import Planeteer from "./Planeteer";

function PlaneteersContainer({planeteers,quote,setQuote}) {
  return (
    <ul className="cards">
      {planeteers.map((planeteer)=>{
        return(
          <Planeteer
            key={planeteer.name}
            planeteer={planeteer}
            quote={quote}
            setQuote={setQuote}
          />
        )
      })}
    </ul>
  );
}

export default PlaneteersContainer;
